import { Component } from "react";

import { useSelector, useDispatch, connect } from "react-redux";
import classes from "./Counter.module.css";

//function based component
const Counter = () => {
  const dispatch = useDispatch();

  const counter = useSelector((state) => state.counter);

  const incrementHandler = () => {
    dispatch({ type: "increment" });
  };

  const decrementHandler = () => {
    dispatch({ type: "decrement" });
  };

  const toggleCounterHandler = () => {};

  return (
    <main className={classes.counter}>
      <div className={classes.header}>
        <div className={classes.section}>
          <img src="/Instagram_logo.jpg" alt="Inst" className={classes.image} />
        </div>
        <div className={classes.section}></div>
        <div className={classes.section}>
          <button onClick={incrementHandler}>Log In</button>
          <button onClick={incrementHandler} className={classes.signup}>
            Sign Up
          </button>
        </div>
      </div>

      <div className={classes.lower}>
        <div className={classes.profile}>
          <div className={classes.procontent}>left</div>
          <div className={classes.procontent}>

            <div className={classes.midcontainer}>
              <div className={classes.rowfirst}>
                <div className={classes.left}></div>
                <div className={classes.right}></div>
              </div>
              <div className={classes.rowtag}></div>
              <div className={classes.rowpics}></div>
            </div>
          </div>
          <div className={classes.procontent}>right</div>
        </div>
        <div>
          <button onClick={incrementHandler}>Increment</button>
          <button onClick={incrementHandler}>INcrease by 5</button>
          <button></button>
        </div>
        <button onClick={toggleCounterHandler}>Toggle Counter</button>
      </div>
    </main>
  );
};

export default Counter;
